  firstName: String,
  lastName: String,
  avatar: String,
  emails: [{
    type: String,
    trim: true,
    lowercase: true,
    unique: true,
    required: 'Email address is required',
    validate: [validateEmail, 'Please fill a valid email address'],
    match: [/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/, 'Please fill a valid email address']
  }],
  password: String,
  points: Number,
  rank: Number,
  avatar: String,
  address: String,
},
  {
    timestamps: true
  });

export default mongoose.model("users", userSchema);

